# 绘制散点图
def scatter_plot(similarities_rbo, dpi=600):
    import matplotlib.pyplot as plt
    import numpy as np

    # 计算平均值
    average_rbo = np.mean(similarities_rbo)

    # 创建图形对象并设置 DPI
    plt.figure(dpi=dpi)

    # 绘制散点图
    plt.scatter(range(len(similarities_rbo)), similarities_rbo, color='royalblue', alpha=0.5)

    # 添加平均值线
    plt.axhline(y=average_rbo, color='red', linestyle='--', label=f'Average RBO: {average_rbo:.3f}')

    # 添加标题和标签
    plt.xlabel('Pair Index', fontsize=14)
    plt.ylabel('RBO', fontsize=14)
    plt.legend(fontsize=14)

    # 显示图形
    plt.show()

    # 保存图形
    # plt.savefig('scatter_plot_high_dpi.png', dpi=dpi)


# 绘制箱线图箱线图
# y轴表示RBO距离的范围，箱体表示RBO距离的中间50%范围，而箱线的顶部和底部表示RBO距离的上下四分位数。箱线图可以帮助你查看RBO距离的分布情况，以及是否存在异常值。
def box_plot(similarities_rbo):
    import matplotlib.pyplot as plt

    # 绘制箱线图
    plt.boxplot(similarities_rbo)

    # 添加标题和标签
    plt.title('RBO Distances')
    plt.ylabel('RBO Distance')

    # 显示图形
    plt.show()


# Rank-Biased Overlap (RBO)
def RBO(list1, list2):
    # p = 1.0 会更比较靠前的元素、越大靠前的元素比例越高、会关心更深的序列， 和下面的基于集合的相似度类似
    return rbo.RankingSimilarity(list1, list2).rbo(p=1.0)

# p = 1时的RBO在结果上很多与其类似
def set_based_similarity(list1, list2, k):
    intersection_sizes = []
    for depth in range(1, k + 1):
        set1 = set(list1[:depth])
        set2 = set(list2[:depth])
        intersection_size = len(set1.intersection(set2))
        intersection_sizes.append(intersection_size / depth)  # 计算交集大小相对于当前深度的比例
    return sum(intersection_sizes) / k  # 计算交集比例的平均值


